Strukturierter Zugriff auf die Versuchsstand-Hardware über dSPACE
@version 1.1
@created 28.05.2013
@revised Aug 2013
@author Andi Dittrich, Thomas Behrmann

Setzen von Werten über DaisyChain Bus (DSI: DAISY CHAIN INPUT - DSO: DAISY CHAIN OUTPUT)
DCO stellt den HardwareBus zur Verfügung und setzt alle Hardware-Systemvariablen (Offline Zustand)
